import React, { useState } from 'react'

const Listing = (props) => {
    const {value, setValue} = useState([
        {"id": "", "name" : "Chandan", "age" : "32",  }
    ])
    const [name, age, location, number] = props
    return(
        <>
            <ul>
                <li>{name} {age} {location} {number}</li>
            </ul>
        </>
    )
}

export default Listing
